import React from "react";
import ReactDOM from "react-dom";
import "./css/index.css";
import App from "./js/App.js";
import test from "./js/test";
import reportWebVitals from "./js/reportWebVitals";

ReactDOM.render(

  <React.StrictMode>
          <test />
          <App />

  </React.StrictMode>,
  document.getElementById("root")
);
//
